const calculateNodePositions = (models: ModelData[], startY = LAYOUT.NODE_START_Y, gap = LAYOUT.NODE_GAP) => {
  return models.reduce(
    (acc, model, index) => {
      acc[model.id] = {
        x: LAYOUT.MODEL_NODE_X,
        y: startY + index * gap
      }
      acc[`${model.id}-keys`] = {
        x: LAYOUT.KEY_NODE_X,
        y: startY + index * gap
      }
      return acc
    },
    {} as Record<string, { x: number; y: number }>
  )
}

